description:
💥 Dự án Tòa văn phòng Mặt phố Lê Văn Lương, 6900m2 30T, MT 1000m, 750 Tỷ 💥 
---------------------------- 
CHUYỂN NHƯỢNG DỰ ÁN TỔ HỢP VĂN PHÒNG DVTM VÀ NHÀ Ở LÊ VĂN LƯƠNG THANH XUÂN
- Vị trí: 21 Lê Văn Lương, Q. Thanh Xuân, TP. Hà Nội;
- Diện tích: 6.900m2, Diện tích nghiên cứu: 4.700m2, Diện tích Xây dựng: 2.000m2;
+tòa cao 30 tầng + 3 tầng hầm;
+ Tổng diện tích sàn: 57.600m2;
+ Tổng số căn hộ: 327 căn (Diện tích từ 70m2 - 120m2);
+ Khối TM: tầng 1 - 3, Khối VP: tầng 4 - 7, Chung cư từ tầng 8 - 30;
- Đã hoàn thiện phần móng, hầm. Phần thân: Block A đã xây đến tầng 24, Block B đã xây đến tầng 23 và xây bao ngoài đến tầng 16;
- Hình thức chuyển nhượng: 100% CP hiện trạng Công ty.
Yêu cầu vào làm việc với Khách hàng:
- Cung cấp Thư quan tâm; Đăng ký Kinh doanh;
- Sao kê CMTC thời điểm hiện tại (30% giá trị mua bán theo Luật TM);
---------------------------- 
🚀 GIÁ BÁN CHỈ: 750 TỶ (ẢNH THẬT-THÔNG TIN THẬT-NHÀ THẬT-GIÁ THẬT)
---------------------------- 
☎️ Liên hệ ngay (24/7): PHƯƠNG_NHÀ_PHỐ       
(Chuyên Tòa văn phòng, Dự Án, Khách Sạn, Building Hà Nội).
Kết nối trực tiếp chủ nhà, giúp ACE mua giá tốt nhất
Miễn phí tư vấn, xem nhà 100%...
